        "id": 4431,
        "body": "<p><strong>Game Design Statement</strong></p>\n<p><strong>Level 1:<span>&nbsp;</span></strong><strong>Lesson 4: Assignment</strong></p>\n<p>&nbsp;</p>\n<p><span>By drafting a design statement, you will be forming your concept into a more concrete document to be submitted at the end of the program. Fill in the blanks below to form the official Design Statement for your project.</span></p>\n<p>&nbsp;</p>\n<p><span>Please provide enough information so that anyone reading this will understand what your game is about, how its played, and what they will get from playing it. Try to sell your idea as if you are trying to get someone to fund it; make them believe in it.</span></p>\n<p>&nbsp;</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><strong>I am creating a Game With Purpose called: (NAME OF GAME)</strong></p>\n</td>\n</tr>\n<tr>\n<td>Survivors</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><strong>That addresses the topic of: (BRIEF DESCRIPTION OF TOPIC)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><span>The town is having monsters, they destroy the trees, causing fire forests, air and water pollution. Humans have to fight those monsters and recreate the earth to avoid the global warming.</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<table style=\"width: 33.7507%;\">\n<tbody>\n<tr>\n<td style=\"width: 100%;\">\n<p><strong>This is an important topic because: (WHY THIS TOPIC MATTERS)</strong></p>\n</td>\n</tr>\n<tr>\n<td style=\"width: 100%;\">\n<p><span>It's important because the pollutions affect human's daily life and easily run out of natural resources.</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><strong>Players of my game will: (GAME'S MECHANICS)</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><span>Players will find materials appear around.</span></p>\n<p><span>Feature as a maze game.</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<table style=\"width: 62.1872%;\">\n<tbody>\n<tr>\n<td style=\"width: 100%;\">\n<p><strong>In order to: (GAME'S GOAL)</strong></p>\n</td>\n</tr>\n<tr>\n<td style=\"width: 100%;\">\n<p><span>Avoid touching monsters and the obstacles.</span></p>\n<p><span>Pick up as much as materials need.</span></p>\n</td>\n</tr>\n</tbody>\n</table>",
